import React, { Component } from 'react';
import { Link } from "react-router-dom";
import './navbar.css'


class Navbar extends Component{

  constructor(props){
    super(props);

    this.state = {
        err:"",
        authenticated:"",
    }

    this.handleSubmit = this.handleSubmit.bind(this);

}


  render() {

    return (
        <div className="Navbar">

          <Link className={this.state.home ? 'text-strike' : null} to="/" >Home</Link>
          <Link className={this.state.settings ? 'text-strike' : null} to="/settings">Settings</Link>
          <Link className={this.state.logout ? 'text-strike' : null} to="/" onClick = { this.props.logOut } > Logout </Link>

        </div>
    )
  }
}

export default Navbar;
